import React from 'react';

const styles={
    h1: {
        marginTop: '25vh',
        color: 'lightgrey',
    },
    button: {
        // color: 'grey',
        // padding: '1%',
        backgroundColor: 'inherit',
        // borderColor: 'grey'
         display:"inline-block",
         padding:"0.35em 1.2em",
         border:"0.1em solid lightgrey",
         margin:"0 0.3em 0.3em 0",
         borderRadius:"0.12em",
         boxSizing: "border-box",
         textDecoration:"none",
         fontWeight:"300",
         color:"lightgrey",
         textAlign:"center",
         transition: "all 0.2s",

    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    h1end: "</h1>",
}
const Newlanding = () => {

    return(

        <>
        <br></br> 
        <p>{tags.htmlstart}</p>       
        <center>
            <h1 style={styles.h1}>Chase Lipscomb Web Developer</h1>
            <a href='/Portfolio'><button style={styles.button}
href='/Portfolio'                onMouseOut={({target})=>{
                    target.style.color='lightgrey'
                    target.style.color='lightgrey'
                }}
                onMouseOver={({target})=>{
                    target.style.color='white'
                    target.style.borderColor='white'
                    }}>View Work</button></a>
            </center>
        </>

    )
}
export default Newlanding
